import React, { useState } from "react";
import "./we-shop-popup.scss";

function WeShopPopUp(props) {
  return (
    <div className="popup">
      <h1>{props.text}</h1>
      <button onClick={e => props.closePopup()}>close me</button>
    </div>
  );
}
export default WeShopPopUp;
